import React from "react";

import BearCarousel, {
    TBearSlideItemDataList,
    BearSlideItem,
} from "bear-react-carousel";
import "bear-react-carousel/dist/index.css";

export default function Carrousel() {
    const images = [
        { id: 1, imageUrl: "../assets/images/logo.png" },
        { id: 2, imageUrl: "../assets/images/leaf.png" },
        { id: 3, imageUrl: "../assets/images/img1.png" },
    ];

    const bearSlideItemData = images.map((row) => {
        return {
            key: row.id,
            children: <BearSlideItem imageUrl={row.image} />,
        };
    });

    return <BearCarousel data={bearSlideItemData} staticHeight="200px" />;
}
